Composição Sbeltchá:
Porangaba, centella asiática, cavalinha, camomila. (Cordia Ecalyculata, Centella asiática, Eouisetum Arvense, Chamomilla Recutita).

 Auxilia na queima da gordura corporal;
 Acelera o metabolismo;
 Ajuda na digestão;

Composição Linfachá:
Hibisco, chá verde, carqueja, alecrim, hortelã, sálvia, mate verde, gengibre e guaraná. (sabdariffa L., Camellia sinensis, Baccharis trimera, Rosmarinus officinalis, Mentha, Salvia officinalis, Ilex paraguariensis, Zingiber officinale e Paullinia cupana)

 Ajuda na queima da gordura corporal;
 Auxilia na eliminação das toxinas e líquidos;

Composição Superchá SB
Porangaba, centella asiática, cavalinha, camomila, carqueja, capim limão e salsa. (Cordia Ecalyculata, Centella asiática, Foliculos Cassia, Eouisetum Arvense, Chamomilla Recutita, Baccharis articulata, Cymbopogon Citratus e Petroselinum crispum.)

 Ajuda a eliminar as toxinas do corpo;
 Ajuda a promover a limpeza do organismo;
 Auxilia na digestão e funcionamento intestinal.

Modo de preparo
Coloque 2 colheres de sopa de Super chá em 1 litro de água fervida. Deixe em infusão por 15 minutos. SIRVA QUENTE OU GELADO, CONSUMIR EM ATÉ 24 HORAS.

Contra indicação
Deve-se consumir o chá no mesmo dia do preparo, podendo ser ingerido quente ou frio.

